define({"topics" : [{"title":"<strong class=\"ph b\">Classifying UI-interactive actions</strong>","shortdesc":"\n                        <p class=\"shortdesc\">Timing settings used for a given action are largely determined by the type of action it             is. Actions that interact\n                           with the AUT can be classified into <dfn class=\"term\">UI-testing</dfn>             and <dfn class=\"term\">UI-interfacing</dfn> actions. Each group can be further classified into             subgroups. \n                        </p>\n                     ","id":"timing_classifying_actions","href":"TA_Automation\/Topics\/timing_classifying_actions.html","menu": {"hasChildren":false,},"tocID":"timing_classifying_actions-d46e35707","topics":[]},{"title":"Conditions and preconditions","shortdesc":"\n                        <p class=\"shortdesc\"> The execution of an action may involve one or more UI-related tests that must be   satisfied before the primary function\n                           of the action can be executed. \n                        </p>\n                     ","id":"timing_preconditions","href":"TA_Automation\/Topics\/timing_preconditions.html","menu": {"hasChildren":false,},"tocID":"timing_preconditions-d46e35725","topics":[]}]});